import React from 'react'

const ProjectItem = (props) => {
    const {item} = props;

    return (
        <div>
            <p>{item.url}</p>
            <p>{item.title}</p>
            <p>{item.github}</p>
            <p>{item.livedemo}</p>
            <p>{item.description}</p>
        </div>
    )
}

export default ProjectItem
